import React from 'react';
import { BrowserRouter, Route, Link, Switch } from "react-router-dom";
import About from './about'
import Home from './home'
const Main = () => {

  
  return ( <div>

<BrowserRouter>
    <Switch>
      <Route exact path="/" component={Home}/>
      <Route exact path="/about" component={About}/>
    </Switch>
</BrowserRouter>
      

  </div> );
}
 
export default Main;
